script: |
  super -f text -I q6376.spq | sort > q6376.out

inputs:
  - name: q6376.spq
    data: |
      SELECT - col2 AS col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT ( - col1 ) + - 40 IN ( + + col0, + ( + 98 ) * - - col2 );
  - name: tab0

outputs:
  - name: q6376.out
    data: |
      -10
      -47
      -99
